import {
    SVG
} from '@svgdotjs/svg.js';
import Filter from "@svgdotjs/svg.filter.js";


var draw;
var filter;
var blur;
var filter_id;
class Blur extends Highway.Transition {
    out({
        from,
        done
    }) {
        // draw = SVG().addTo("body").size('100%', '100%');

        // filter = draw.filterWith(function (add) {
